package site.jackwang.entity;import java.util.Date;/** * T_USER * * @Description * @Author wangjie<https://my.oschina.net/xiaowangqiongyou> * @Date 2017/05/05 */public class User {    private Integer id;    private String userName;    private String password;    private String state;    private Date createTime;    private String name;    private String position;    private String response;    private String division;    public User() {    }    public User(String userName, String password) {        this.userName = userName;        this.password = password;    }    public String getPosition() {        return position;    }    public void setPosition(String position) {        this.position = position;    }    public String getResponse() {        return response;    }    public void setResponse(String response) {        this.response = response;    }    public String getDivision() {        return division;    }    public void setDivision(String division) {        this.division = division;    }    public Integer getId() {        return this.id;    }    public void setId(Integer id) {        this.id = id;    }    public String getUserName() {        return this.userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getPassword() {        return this.password;    }    public void setPassword(String password) {        this.password = password;    }    public String getState() {        return this.state;    }    public void setState(String state) {        this.state = state;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    @Override    public String toString() {        final StringBuilder sb = new StringBuilder("User{");        sb.append("id=").append(id);        sb.append(", userName='").append(userName).append('\'');        sb.append(", password='").append(password).append('\'');        sb.append(", state='").append(state).append('\'');        sb.append(", createTime=").append(createTime);        sb.append(", name='").append(name).append('\'');        sb.append('}');        return sb.toString();    }}